script: |
  super -f text -I q418.spq | sort > q418.out

inputs:
  - name: q418.spq
    data: |
      SELECT ALL * FROM tab0 (FORMAT parquet) WHERE - col2 NOT IN ( col2 * col1 * - + 74 + 58 * - 49 * col0, ( + - col0 ), + col1 );
  - name: tab0

outputs:
  - name: q418.out
    data: |
      15	81	47
      87	21	10
      97	1	99
